function updatePosition(position, line) {
  var newPosition = position;
  var instructions = line.split("");
  for (var i = 0; i < instructions.length; i++) {
    newPosition = move(newPosition, instructions[i]);
  }
  return newPosition
}

function move(position, instruction) {
  var direction = directions[instruction];
  var newPosition = [position[0]+direction[0],position[1]+direction[1]]
  newPosition = stayOnKeyboard(newPosition);
  return newPosition;
}

function stayOnKeyboard(position) {
  return [stayInRange(position[0]), stayInRange(position[1])]
}

function stayInRange(integer) {
  if (integer < 0 ) {
    return 0;
  }
  if (integer > 2) {
    return 2;
  }
  return integer;
}
